import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Button, TextField, Typography, Grid } from "@material-ui/core";

class Login extends Component {
    handleClick(e) {
        e.preventDefault();
    }

    render() {
        return (
            <div>
                <h1>If you are an existing client, please log in below.</h1>
                <Grid container alignItems="center" justify="center" alignContent="center" direction="column">

                    <TextField name="username" display="block" label="Username"/>
                    <TextField name="password" display="block" label="Password"/>

                    <Button component={Link} to="/mysessions" color="inherit" onClick={this.handleClick} >Log In</Button>

                </Grid >
            </div >
        );
    }
}

export default Login;
